import React, { Component } from "react";
import axios from "axios";

class Silkum extends Component {
  componentDidMount() {
    
  }
  List() {
    axios
    .get("http://seeho.kro.kr:3010/json")
    .then(function(res) {
        return res
    })
    .catch(function(err) {
      console.log(err);
    });

  }
  render() {    
    return (
      <>
        {this.List().data}
        <div>
        </div>
      </>
    );
  }
}

export default Silkum;
